import {HomePage} from "pages"
import {Layout} from "components/common"
import {SmsLayout} from "components/common/Layout"
import ThemeProvider from "providers/ThemeProvider"
import "dotenv"

function App() {
  return (
    <div className="App">
      <ThemeProvider>
        <Layout>
          <HomePage />
        </Layout>
        <SmsLayout>

        </SmsLayout>
      </ThemeProvider>

    </div>
  );
}

export default App;
